import React, { Component } from 'react'


export class List extends Component {
    constructor(props) {
      super(props)
      this.state = {
         error: null,
         isLoaded: false,
         items: []
      }
    }

    componentDidMount(){
        fetch("https://localhost:7205/api/Client")
        .then(res => res.json())
        .catch(
            (result) => {
                this.setState({
                    isLoaded: true,
                    items: result.id
                });
            },
            (error) => {
                this.setState({
                    isLoaded: true,
                    error
                });
            }
        )
    }

    render() {
        
        
    }
}

export default List
